int
init_zhu(int lgno) {

    register int  i;
    unsigned long cid;

    if (zhu_MAX_TRIGs) {
        languages[lgno].dict = make_dict(2 * zhu_MAX_TRIGs, 0);
        languages[lgno].hash = (double *)malloc(sizeof(double) * zhu_MAX_TRIGs);
        if (!languages[lgno].hash) return(1);
        for (i = 0; i < zhu_MAX_TRIGs; i++) {
           cid = string2id((char *)zhu_hash[i].trig, languages[lgno].dict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].hash[cid] = zhu_hash[i].prob;
        }
        languages[lgno].wdict = make_dict(2 * 7, 0);
        languages[lgno].whash = (double *)malloc(sizeof(double) * 7);
        for ( i = 0; i < 6; i++) {
           cid = string2id((char *)zhu_wordhash[i].word, languages[lgno].wdict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].whash[cid] = zhu_wordhash[i].prob;
        }
    } else languages[lgno].used = 0;

    return(0);
}
